INSERT INTO `komentars` VALUES (1,148,'abdul',1046,'QA','Result SPTT (w/ Quality):\r\nNeed to confirm POSITION & QTY/PLASTIC, due to quality impact of part (Locking area)\r\n\r\nTrial shipping & check critical point: ~23-Dec-22\r\nRequest:\r\n- Fuji seiki check N5 pcs for critical point & give marking\r\n- After trial shipment, AiiA Quality will recheck & compare dimension',NULL,NULL),(2,200,'abdul',1046,'QA','Supplier Propose Tray: Need to judge tray & part position OK/Not --> Matsuo would like to start making tray\r\n\r\n- AiiA need to check tray design 3D (Side view) & compare w/ JPN tray\r\n- AiiA need to confirm to Matsuo and feedback tray design\r\n',NULL,NULL),(3,220,'abdul',1046,'QA','OMD propose to add qty plastic/box to optimize TP331 capacity',NULL,NULL),(4,240,'abdul',1046,'QA','AiiA needs to check whether inside box condition same as JPN\r\nAiiA needs to use box antistatic in line\r\n\r\nRequest to Supplier: Make sure by checking inside packaging condition',NULL,NULL),(5,289,'abdul',1046,'QA','AiiA OMD need to check part actual to confirm the packing\r\nETA AiiA: 19-Dec-22',NULL,NULL),(6,309,'abdul',1046,'QA','- QC feedback: For Marking Area, use marking F 0.5mm. \r\nKojima propose to mark line longer (as part width)\r\nQC: Need to check Kojima proposal (under discussion)\r\n- OMD Feedback: Increase plastic/box --> 4plastic to optimize box capacity',NULL,NULL),(7,329,'abdul',1046,'QA','Supplier need to check plastic condition: same as JPN or not\r\nAlso, type of plastic (Anti Static or Normal)',NULL,NULL),(8,122,'ttmi',10460,'MIM','test feedback',NULL,NULL),(9,1,'ttmi',10460,'MIM','Tolong tambahkan revisi berat pada point 2',NULL,NULL);
